import React, {useState} from "react";
import "./Counter.scss";

const Counter = () => {

    const [counter, setCounter] = useState(0);

    const handleIncrement = () => {
            setCounter(counter + 1);
        }

    const handleDecrement = () => {
          setCounter(counter - 1);
        }

    return (
    <div className="counterBox">
        <button onClick={handleDecrement} className="carousel__arrow carousel__arrow--left">-</button>
        <button onClick={handleIncrement} className="carousel__arrow carousel__arrow--right">+</button>
    </div>
    )
};

export default Counter;
